import React from "react";
import LongCard from "../Components/LongCard";

const Education = () => {
  return (
    <div className="h-screen bg-gradient-to-br from-green-500 to-blue-300">
      <div className="home grid grid-cols-1 gap-4 w-[80%] ml-52 pt-20 bg-slate-500">
        <h1 className="text-4xl text-center">Education</h1>
        <LongCard
          title="Bachelor of Information and Communication Technology Honours(BICT)/Software Engineering"
          description="lorem.........."
        />
      </div>
    </div>
  );
};

export default Education;
